import webRoutes from './routes/web';
import dotenv   from 'dotenv';

let app = express();

dotenv.config(); // load env variables

// config view engine
viewEngine(app);

webRoutes(app)

// config body parser
app.use(bodyParser.json()); 
app.use(bodyParser.urlencoded({ extended: true }));

// init web routes



